  Routes,
  Route,
  Outlet,
  Link,
  useSearchParams,
  useParams,
} from "react-router-dom";
import { Counter } from "./features/counter/Counter";
import MovieComponent from "./components/MovieComponent";
import MovieList from "./components/MovieList";
import FavList from "./components/FavouritesList";
import "bootstrap/dist/css/bootstrap.min.css";
import "./App.css";


function Layout() {
  return (
    <div>
      {/* A "layout route" is a good place to put markup you want to
          share across all the pages on your site, like navigation. */}
      <nav>
        <ul>
          <li>
            <Link to="/">Movie Component</Link>
          </li>
          <li>
            <Link to="/movie-list">MovieList</Link>
          </li>
          <li>
            <Link to="/favouriteslist">FavouritesList</Link>
          </li>
        </ul>
      </nav>
    </div>
  );
}

function App() {
  return (
    <>
      <div>

        <Routes>
          <Route path="/" element={<Layout />}>
            <Route index element={<MovieComponent />} />
            <Route path="movie-list" element={<MovieList />} />
            <Route path="favouriteslist" element={<FavList />} />
          </Route>
